import React from 'react';
import ReactDOM from 'react-dom';
import {placeholder} from "@babel/types";

const TodoList = () => {
    return (
        <ul>
            <li>Learn React</li>
            <li>Get a job of my dream</li>
        </ul>
    )
};

const AppHeader = () => {
    return(
        <h1>My Todo List</h1>
    )
}

const el = (
    <div>
    <AppHeader />
    <input placeholder = 'search' />
    <TodoList />
    </div>
);

ReactDOM.render(el, document.getElementById('root'))
